import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../../contexts/AuthContext';

const Login = () => {
  const [formData, setFormData] = useState({
    email: '',
    password: ''
  });
  const [loading, setLoading] = useState(false);
  const { login } = useAuth();
  const navigate = useNavigate();

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);

    const result = await login(formData.email, formData.password);

    if (result.success) {
      navigate('/dashboard');
    }

    setLoading(false);
  };

  return (
    <div style={{
      maxWidth: '450px',
      margin: '60px auto',
      padding: '0 20px'
    }}>
      <div className="card">
        <div style={{ textAlign: 'center', marginBottom: '32px' }}>
          <div style={{
            // fontSize: '64px',
            // marginBottom: '16px',
            // color: '#007bff',
            // fontWeight: '700'
          }}>
            Sign In
          </div>
          <h2 style={{
            // color: '#333',
            // fontSize: '2rem',
            // fontWeight: '700',
            // marginBottom: '8px'
          }}>
            Sign In
          </h2>
          <p style={{ color: '#6c757d', fontSize: '1.1rem' }}>
            Sign in to your Store Ratings account
          </p>
        </div>

        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label htmlFor="email" className="form-label">
              Email Address
            </label>
            <input
              type="email"
              id="email"
              name="email"
              className="form-control"
              value={formData.email}
              onChange={handleChange}
              placeholder="Enter your email address"
              required
            />
          </div>

          <div className="form-group">
            <label htmlFor="password" className="form-label">
              Password
            </label>
            <input
              type="password"
              id="password"
              name="password"
              className="form-control"
              value={formData.password}
              onChange={handleChange}
              placeholder="Enter your password"
              required
            />
          </div>

          <button
            type="submit"
            className="btn btn-primary"
            style={{
              width: '100%',
              padding: '16px',
              fontSize: '16px',
              fontWeight: '600',
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
              gap: '8px'
            }}
            disabled={loading}
          >
            {loading ? (
              <>
                <span>Loading...</span>
                Signing in...
              </>
            ) : (
              <>
                Sign In
              </>
            )}
          </button>
        </form>

        <div style={{
          textAlign: 'center',
          marginTop: '24px',
          padding: '20px',
          borderTop: '2px solid #f1f3f4'
        }}>
          <p style={{ color: '#6c757d', marginBottom: '8px' }}>
            Don't have an account?
          </p>
          <Link to="/register" style={{
            color: '#007bff',
            textDecoration: 'none',
            fontWeight: '600',
            fontSize: '1.1rem'
          }}>
            Create Account
          </Link>
        </div>

        <div style={{
          marginTop: '32px',
          padding: '24px',
          backgroundColor: '#f8f9fa',
          borderRadius: '16px',
          border: '2px solid #e9ecef'
        }}>
          <h4 style={{
            marginBottom: '16px',
            color: '#333',
            display: 'flex',
            alignItems: 'center',
            gap: '8px'
          }}>
            Demo Credentials
          </h4>
          <div style={{ fontSize: '14px', lineHeight: '1.8' }}>
            <div style={{
              display: 'flex',
              alignItems: 'center',
              gap: '8px',
              marginBottom: '8px',
              padding: '8px 12px',
              backgroundColor: 'rgba(0, 123, 255, 0.1)',
              borderRadius: '8px'
            }}>
              <span style={{ fontWeight: '600', color: '#007bff' }}>Admin:</span>
              <span style={{ color: '#6c757d' }}>admin@example.com / Admin123!</span>
            </div>
            <div style={{
              display: 'flex',
              alignItems: 'center',
              gap: '8px',
              marginBottom: '8px',
              padding: '8px 12px',
              backgroundColor: 'rgba(40, 167, 69, 0.1)',
              borderRadius: '8px'
            }}>
              <span style={{ fontWeight: '600', color: '#28a745' }}>Store Owner:</span>
              <span style={{ color: '#6c757d' }}>storeowner@example.com / Store123!</span>
            </div>
            <div style={{
              display: 'flex',
              alignItems: 'center',
              gap: '8px',
              padding: '8px 12px',
              backgroundColor: 'rgba(255, 193, 7, 0.1)',
              borderRadius: '8px'
            }}>
              <span style={{ fontWeight: '600', color: '#ffc107' }}>User:</span>
              <span style={{ color: '#6c757d' }}>user@example.com / User123!</span>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Login;
